# This file contains pin mappings for the Creality Ender 5 Plus.
# Ender 5 Plus stock uses a Creality v2.2 board, similar to CR-20 Pro.
# To use this config, the firmware should be compiled for the AVR
# atmega2560.

# See docs/Config_Reference.md for a description of parameters.
[include can.cfg]
[include shell_command.cfg]
[include timelapse.cfg]
[include macros.cfg]
[include mainsail.cfg]
[include custom macros.cfg]

[mcu]
#serial: /dev/serial/by-id/usb-Klipper_stm32h743xx_400029000B51303138393138-if00
canbus_uuid: 484d0cbd141d

[virtual_sdcard]
path: /home/klipper/E5P_data/gcodes
on_error_gcode: CANCEL_PRINT



[exclude_object]


######################################################################
# BED LEVELING
######################################################################


[beacon]
serial: /dev/serial/by-id/usb-Beacon_Beacon_RevD_253FEC0C515137474C202020FF0D402C-if00
x_offset: 0 # update with offset from nozzle on your machine
y_offset: -33.8 # update with offset from nozzle on your machine
mesh_main_direction: x
mesh_runs: 2

[safe_z_home]
home_xy_position: 178.1, 180.5 # Change coordinates to the center of your print bed
speed: 100
z_hop: 3 # Move up 3mm
z_hop_speed: 20

[bed_mesh]
speed: 200
horizontal_move_z: 0
mesh_min: 12, 6.2
mesh_max: 349.2, 327.2
probe_count: 50, 50
algorithm: bicubic
mesh_pps: 2,2
fade_start: 1.0
fade_end: 10.0
fade_target: 0.0

[screws_tilt_adjust]
screw1: 29.5, 76.5
screw1_name: Front Left screw
screw2: 29.5, 336.5
screw2_name: Back Left
screw3: 329.5, 336.5
screw3_name: Back Right
screw4: 329.5, 76.5
screw4_name: Front Right
screw5: 178.4, 177
screw5_name: Center
horizontal_move_z: 2
speed: 150
screw_thread: CW-M4

[z_tilt]
z_positions: 8, 211
           345, 211
# A list of X,Y coordinates (one per line; subsequent lines
# indented) describing the location of each bed "pivot point". The
# "pivot point" is the point where the bed attaches to the given Z
# stepper. It is described using nozzle coordinates (the XY position
# of the nozzle if it could move directly above the point). The
# first entry corresponds to stepper_z, the second to stepper_z1,
# the third to stepper_z2, etc. This parameter must be provided.
points: 8, 211
        345, 211
          
# A list of X,Y coordinates (one per line; subsequent lines | back |
# indented) that should be probed during a Z_TILT_ADJUST command. | |
# Specify coordinates of the nozzle and be sure the probe is above L z1 z R
# the bed at the given nozzle coordinates. This parameter must be | |
# provided. | front |
speed: 150
horizontal_move_z: 2
retries: 20
# Number of times to retry if the probed points aren't within
# tolerance.
retry_tolerance:0.001
# If retries are enabled then retry if largest and smallest probed
# points differ more than retry_tolerance. Note the smallest unit of
# change here would be a single step. However if you are probing
# more points than steppers then you will likely have a fixed
# minimum value for the range of probed points which you can learn
# by observing command output.

# This file contains common pin mappings for the BigTreeTech SKR 3.
# To use this config, the firmware should be compiled for the
# STM32H743 with a "128KiB bootloader".

# See docs/Config_Reference.md for a description of parameters.


######################################################################
# X Stepper
######################################################################


[stepper_x]
step_pin: PD4
dir_pin: !PD3
enable_pin: !PD6
microsteps: 128
rotation_distance: 40
endstop_pin: ^PC1
position_endstop: 356.2
position_max: 356.2
#position_min:-20
homing_speed: 100

[tmc2209 stepper_x]
uart_pin: PD5
run_current: 0.650
diag_pin:
interpolate: False
#stealthchop_threshold: 999999

######################################################################
# Y Stepper
######################################################################

[stepper_y]
step_pin: PA15
dir_pin: !PA8
enable_pin: !PD1
microsteps: 128
rotation_distance: 40
endstop_pin: ^PC3
position_endstop: 361
position_max: 361
#position_min:-10
homing_speed: 100

[tmc2209 stepper_y]
uart_pin: PD0
run_current: 0.650
diag_pin:
interpolate: False
#stealthchop_threshold: 999999

######################################################################
# Z & Z1 Stepper
######################################################################

[stepper_z]
step_pin: PE2
dir_pin: !PE3
enable_pin: !PE0
microsteps: 128
rotation_distance: 4
endstop_pin: probe:z_virtual_endstop
#position_endstop: 0.5
position_max: 425
position_min: -5
homing_speed: 20
homing_retract_dist: 0

[tmc2209 stepper_z]
uart_pin: PE1
run_current: 0.650
diag_pin:
interpolate: False
#stealthchop_threshold: 999999

[stepper_z1]
step_pin: PD11
dir_pin: !PD10
enable_pin: !PD13
microsteps: 128
rotation_distance: 4
#endstop_pin: PC13
#position_endstop: 0.5
#position_max: 200

[tmc2209 stepper_z1]
uart_pin: PD12
run_current: 0.650
diag_pin:
interpolate: False
#stealthchop_threshold: 999999

######################################################################
# Extruder
######################################################################


[extruder]
#step_pin: PD15
#dir_pin: !PD14
#enable_pin: !PC7
#microsteps: 16
#gear_ratio: 50:8
#rotation_distance: 23.057
#nozzle_diameter: 0.60
#filament_diameter: 1.750
#max_extrude_cross_section:5
#heater_pin: PB3
#sensor_type: PT1000
#sensor_pin: PA2
#control: pid
#pid_Kp: 22.2
#pid_Ki: 1.08
#pid_Kd: 114
#min_temp: 0
#max_temp: 300
#max_extrude_only_distance: 450
#min_extrude_temp: 0
#pressure_advance: 0.05
#pressure_advance: 0.04
#control: pid
#pid_Kp: 21.527
#pid_Ki: 1.063
#pid_Kd: 108.982

#[tmc2209 extruder]
#uart_pin: PC6
#run_current: 0.28
#diag_pin:
#stealthchop_threshold: 999999

#[firmware_retraction]
#retract_length: 3
#   The length of filament (in mm) to retract when G10 is activated, and to
#   unretract when G11 is activated (but see unretract_extra_length below).
#   The default is 0 mm.
#retract_speed: 25
#   The length (in mm) of *additional* filament to add when unretracting.
#unretract_extra_length: 0
#   The speed of retraction, in mm/s. The default is 20 mm/s.
#unretract_speed:25

#[gcode_macro SET_RETRACTIONLENGTH]
#gcode:
#  SET_RETRACTION RETRACT_LENGTH={params.LENGTH|float}
#  GET_RETRACTION


######################################################################
# Heated Bed
######################################################################

[heater_bed]
heater_pin: PD7
sensor_type: Generic 3950
sensor_pin: PA1
min_temp: 0
max_temp: 120
#control: pid
#pid_Kp: 22.2
#pid_Ki: 1.08
#pid_Kd: 114

######################################################################
# Fans
######################################################################

#[fan]
#pin: PB7

#[heater_fan hotend_fan]
#pin: PB6
#heater: extruder
#heater_temp:50.0

#[temperature_fan controller_fan]
#pin: PB5
#control: watermark
#max_delta: 3.0
#sensor_type: temperature_mcu
#min_temp: 0
#max_temp: 100
#target_temp: 40

#[temperature_sensor MCU]
#sensor_type: temperature_mcu

[multi_pin controller_fan_pins]
pins: PB7, PB6

[temperature_fan controller_fan]
pin: multi_pin: controller_fan_pins
control: watermark
max_delta: 3.0
sensor_type: temperature_mcu
min_temp: 0
max_temp: 100
target_temp: 40







######################################################################
# Printer
######################################################################



[printer]
kinematics: cartesian
max_velocity: 300
max_accel: 4000
#max_accel_to_decel: 3000
max_z_velocity: 5
square_corner_velocity: 5.0
max_z_accel: 100

[input_shaper]
#shaper_type_x: mzv
#shaper_freq_x: 42.0
#shaper_type_y: mzv
#shaper_freq_y: 41.8



########################################
# EXP1 / EXP2 (display) pins
########################################

[board_pins]
aliases:
    # EXP1 header
    EXP1_1=PC5, EXP1_3=PB1, EXP1_5=PE9,  EXP1_7=PE11, EXP1_9=<GND>,
    EXP1_2=PB0, EXP1_4=PE8, EXP1_6=PE10, EXP1_8=PE12, EXP1_10=<5V>,
    # EXP2 header
    EXP2_1=PA6, EXP2_3=PE7, EXP2_5=PB2, EXP2_7=PC4,   EXP2_9=<GND>,
    EXP2_2=PA5, EXP2_4=PA4, EXP2_6=PA7, EXP2_8=<RST>, EXP2_10=<NC>

######################################################################
#  MCU & Raspberry Pi Temps
######################################################################


[temperature_sensor raspberry_pi]
sensor_type: temperature_host
min_temp: 10
max_temp: 100




######################################################################
# Filament Sensor
######################################################################

[filament_motion_sensor encoder_sensor]
detection_length: 50
#   The minimum length of filament pulled through the sensor to trigger
#   a state change on the switch_pin
#   Default is 7 mm.
extruder: extruder
#   The name of the extruder section this sensor is associated with.
#   This parameter must be provided.
switch_pin: PC2
# changing the switch_pin name according to your motherboard
pause_on_runout: False
#runout_gcode: m600
#insert_gcode:
#event_delay:
#pause_delay:

